window.bookSummaryJSON = "<p>Alex and his three friends drop out of college after discovering a revolutionary way to travel into space using a small amount of energy. Their world-changing technology is sought by the government, and they are forced to go into hiding while they perfect it. Their adventures into orbit and beyond become a global sensation. As they navigate fame, family, and those who are determined to stop them, little do they know that their little startup could have galactic consequences once they discover a derelict spaceship.</p>"; 
